import React, { Component } from 'react';
import Provider from '@react/react-spectrum/Provider';
import ProtoShell from './Shell';
import ProtoNav from './SideNav';
import ProtoTableView from './TableView';
import ProtoHeader from './Breadcrumb';

class Proto3 extends Component {
    render() {
        return (
            <Provider theme='light' style={{ "backgroundColor": "rgb(245, 245, 245)", "height": "calc=(100vh - 52px)" }}>
                <ProtoShell></ProtoShell>
                <div className="Container">
                    <div className="Container-body">
                        <div className="Container-content">
                        <h1>Proto3</h1>
                            <ProtoHeader></ProtoHeader>
                            <ProtoTableView></ProtoTableView>
                        </div>
                        <nav className="Container-nav"><ProtoNav></ProtoNav></nav>
                        <aside className="Container-rRail" style={{"maxWidth":"0","padding":"0"}}>adsadsadsadsadsadsadsadsadsadsadsadsadsadsadsadsads</aside>
                    </div>
                </div>
            </Provider>
        );
    }
}

export default Proto3                          
;
